import React from 'react';
import './App.css';
const App = () => {
  return (
      <div className='app-wrapper'>
          <header className='header'>
              <img src='https://upload.wikimedia.org/wikipedia/commons/9/90/Magic8ball.jpg'/>
          </header>
       <nav className='nav'>
           <div><a>Profile</a></div>
           <div><a>Messages</a></div>
           <div><a>News</a></div>
           <div><a>Music</a></div>

       </nav>
    </div>

  );
}
export default App;
